import React from 'react';
import './styles/css/reset.css';
import gif1 from './styles/assets/guile.gif';
import gif2 from './styles/assets/ken.gif';
import './App.css';
import Tap from './components/fightZone/Tap';
import Home from './components/home/Home';

function App() {
  return (
    <div className="App">
      <Home />
      {/* ------------------------------- home ------------------------------------ */}
      <div className="animation">
        <img className="gif1" src={gif1} alt="guile" />
        <div className="button" onClick="">
          <input className="play" type="button" value="PLAY" />
        </div>
        <img className="gif2" src={gif2} alt="ken" />
      </div>
      {/* ------------------------------- home ------------------------------------ */}

      {/* ------------------------------- zone de fight --------------------------- */}
      <div className="buttonFight">
        <Tap />
        <Tap />
      </div>
      {/* ------------------------------- zone de fight --------------------------- */}
    </div>
  );
}

export default App;
